import React from "react";
import HelpPopup from "./HelpPopup";

function Header() {
    const displayHelpPopup = () => {
        document.getElementById("help-popup").classList.add("active");
    };

    return (
        <header>
            <nav className="navbar">
                <div className="logo">WWU Schedule Optimizer</div>
                <button
                    className="nav-button"
                    onClick={displayHelpPopup}
                    title="Display Help Menu">
                    Help
                </button>
                <div className="help-popup" id="help-popup">
                    <HelpPopup />
                </div>
            </nav>
        </header>
    );
}

export default Header;
